import React from 'react';

const person = (Props) => {
    return (
        <div>
            <h2>Hey this is parent component</h2>
            <p>this parent is great. My name is <span style={{color: "red"}}></span>{Props.name} and I am { Math.floor(Math.random() * 30) } yrs old</p>
            <p>{Props.children}</p>
        </div>
    );
}

export default person;
